proxy-groups:
  - name: نوع انتخاب پروکسی 🔀
    icon: https://www.svgrepo.com/show/412721/choose.svg
    type: select
    proxies:
      - خودکار (بهترین پینگ) 🤖
      - دستی 🤏🏻
      - پشتیبان (در صورت قطعی) 🧯
      - بدون فیلترشکن 🛡️
  - name: دستی 🤏🏻
    type: select
    icon: https://www.svgrepo.com/show/372331/cursor-hand-click.svg
    use:
      - proxy
  - name: خودکار (بهترین پینگ) 🤖
    type: url-test
    icon: https://www.svgrepo.com/show/7876/speedometer.svg
    url: https://api.v2fly.org/checkConnection.svgz
    interval: 600
    timeout: 120000
    tolerance: 500
    lazy: true
    use:
      - proxy
  - name: پشتیبان (در صورت قطعی) 🧯
    type: fallback
    icon: https://www.svgrepo.com/show/415208/backup-cloud-document.svg
    url: https://www.gstatic.com/generate_204
    interval: 600
    timeout: 120000
    lazy: true
    use:
      - proxy
  - name: تلگرام 💬
    type: select
    icon: https://www.svgrepo.com/show/354443/telegram.svg
    proxies:
      - نوع انتخاب پروکسی 🔀
      - بدون فیلترشکن 🛡️
      - خودکار (بهترین پینگ) 🤖
      - دستی 🤏🏻
      - پشتیبان (در صورت قطعی) 🧯
      - اجازه ندادن 🚫
  - name: سایتای ایرانی 🇮🇷
    type: select
    icon: https://upload.wikimedia.org/wikipedia/commons/3/36/Flag_of_Iran_%28civil%29.svg
    proxies:
      - بدون فیلترشکن 🛡️
      - اجازه ندادن 🚫
      - نوع انتخاب پروکسی 🔀
      - خودکار (بهترین پینگ) 🤖
      - دستی 🤏🏻
      - پشتیبان (در صورت قطعی) 🧯
  - name: بدون فیلترشکن 🛡️
    type: select
    icon: https://www.svgrepo.com/show/6318/connection.svg
    proxies:
      - DIRECT
    hidden: true
  - name: اجازه ندادن 🚫
    type: select
    icon: https://www.svgrepo.com/show/444307/gui-ban.svg
    proxies:
      - REJECT
    hidden: true
rule-providers:
  apps:
    type: http
    format: yaml
    behavior: classical
    url: "https://github.com/chocolate4u/Iran-clash-rules/releases/latest/download/apps.yaml"
    path: ./ruleset/apps.yaml
    interval: 86400
proxy-providers:
  proxy:
    type: http
    url: https://raw.githubusercontent.com/tahmaseb73/ClashFactory/main/providers/Eswatini.txt
    interval: 3600
    path: ./providers/Eswatini.txt
    health-check:
      enable: true
      interval: 3600
      url: "https://www.gstatic.com/generate_204"
